INSERT INTO `catering_category` VALUES("1", "BUFF BELLO", "V&aring;r mest s&aring;lda buff&eacute;, i denna ing&aring;r fem st antipasti, en valfri pastar&auml;tt samt br&ouml;d med tapenad.", "Denna buffe g&aring;r &auml;ven att f&aring; fri fr&aring;n gluten och laktos.", "10", "0", "1", "0");
INSERT INTO `catering_category` VALUES("2", "BUFF PRONTO", "En mycket popul&auml;r buff&eacute;, i denna ing&aring;r tv&aring; st antipasti, en valfri pastar&auml;tt samt br&ouml;d med tapenad.", "Denna buffe g&aring;r &auml;ven att f&aring; fri fr&aring;n gluten och laktos.", "10", "0", "1", "0");
INSERT INTO `catering_category` VALUES("3", "BUFF NONNA", "En buff&eacute; med kalvfile, i denna ing&aring;r tre st antipasti, en kalvfiler&auml;tt samt br&ouml;d med tapenad.", "", "10", "0", "1", "0");
INSERT INTO `catering_category` VALUES("4", "BUFF ZIO", "En buff&eacute; med oxfile, i denna ing&aring;r tre st antipasti, en valfri oxfiler&auml;tt samt br&ouml;d med tapenad.", "", "10", "0", "1", "0");
INSERT INTO `catering_category` VALUES("5", "BUFF PESCATORE", "En buff&eacute; med bergtunga, i denna ing&aring;r tre st antipasti, bergtunga samt br&ouml;d med tapenad.", "", "10", "0", "1", "0");
INSERT INTO `catering_category` VALUES("6", "BUFF PICCOLO", "En l&auml;ttare buff&eacute; som passar till en enklare tillst&auml;llning, i denna ing&aring;r fem st antipasti samt br&ouml;d med tapenad.", "", "10", "0", "1", "0");
INSERT INTO `catering_category` VALUES("7", "CROSTINI, BAULETTI, BLINIER", "Dessa tilltugg passar perfekt till f&ouml;rdrinken. V&auml;lj en till tre varianter fr&aring;n menyn nedan. Vi rekommenderar att man r&auml;knar p&aring; tre stycken per person.", "", "10", "3", "1", "0");
INSERT INTO `catering_category` VALUES("8", "DOLCE", "F&ouml;r er som &auml;r sugna p&aring; n&aring;got s&ouml;tt efter maten, v&auml;lj en av v&aring;ra desserter.", "F&ouml;r ett enklare tilltugg till kaffet finns m&ouml;jlighet att best&auml;lla fat med Italienska kakor, typ biscotti. Vid intresse prata med oss om f&ouml;rslag och priser.", "5", "1", "1", "0");
