INSERT INTO `menu_meny` VALUES("2", "0", "4", "3", "Bruschetta tricolore", "<p>Italienskt lantbr&ouml;d gratinerat med buffelmozzarella tomat, vitl&ouml;k och parmaskinka</p>\r\n<p><span style=\"font-size: 8pt;\"><em>Italian bread au gratin with buffalo mozzarella cheese,&nbsp;tomato, garlic and parmaham&nbsp;</em></span></p>", "105", "80", "17", "", "0", "1", "1,2", "2", "fix", "0");
INSERT INTO `menu_meny` VALUES("3", "0", "4", "3", "Bresaola della Valtellina", "<p>Lufttorkat oxk&ouml;tt med hyvlad parmesan, citron och rucola</p>\r\n<p><span style=\"font-size: 8pt;\"><em>Bresaola with pecorino, parmesan, lemon and rucola</em></span></p>", "105", "80", "17", "", "0", "1", "1,2", "3", "fix", "0");
INSERT INTO `menu_meny` VALUES("4", "0", "4", "3", "Funghi trifolati", "<p>Vitl&ouml;ksfr&auml;sta skogschampinjoner med vitl&ouml;ksbr&ouml;d</p>\r\n<p><span style=\"font-size: 8pt;\"><em>Garlic fried mushrooms</em></span></p>", "95", "70", "17", "", "0", "1", "1,2", "4", "fix", "0");
INSERT INTO `menu_meny` VALUES("5", "0", "4", "3", "Insalata di mare", "<p>R&auml;kor, bl&auml;ckfisk, musslor, kr&auml;ftstj&auml;rtar, selleri, persilja, f&auml;nk&aring;l, vitl&ouml;k och balsamicodressing</p>\r\n<p><span style=\"font-size: 8pt;\"><em>Seafood salad of calamari, mussels, shrimps&nbsp;and crayfish with balsamico and oliveoil</em></span></p>", "105", "80", "17", "", "0", "1", "1,2", "8", "fix", "0");
INSERT INTO `menu_meny` VALUES("6", "0", "4", "3", "Pasta", "<p>Vi serverar &auml;ven alla v&aring;ra pastar&auml;tter som f&ouml;rr&auml;tt</p>\r\n<p><span style=\"font-size: 8pt;\"><em>We also serve all our pasta dishes as starters&nbsp;</em></span></p>", "135", "0", "20", "", "0", "1", "1", "10", "fix", "0");
INSERT INTO `menu_meny` VALUES("7", "0", "2", "3", "Saltimbocca al Limone", "<p>Kalvfil&eacute; med parmaskinka och salvia br&auml;serad i vitt vin,&nbsp;citron och gr&auml;dde med valfri Contorni.</p>\r\n<p><span style=\"font-size: 8pt;\"><em>Veal with parma ham and sage,&nbsp;lemon sauce and semidryedtomatoe.</em></span></p>", "265", "195", "60", "", "0", "1", "1,2", "4", "fix", "1");
INSERT INTO `menu_meny` VALUES("8", "0", "2", "3", "Filetto con Verze ripieni ", "<p>Grillad oxfiletournedos, savoyk&aring;l fylld med oxragu, russin och pinjen&ouml;tter, picklade gr&ouml;nsaker och r&ouml;dvinss&aring;s med potatisterrin.</p>", "285", "235", "50", "", "1", "1", "1,2", "2", "fix", "0");
INSERT INTO `menu_meny` VALUES("9", "0", "2", "3", "Filetto al Pepe Verde", "<p>Grillad oxfil&eacute;tournedos med grillad chili,&nbsp;gr&ouml;npeppars&aring;s med valfri Contorni.</p>\r\n<p><span style=\"font-size: 8pt;\"><em>Grilled tournedo with grilled chili, greenpeppersauce.</em></span></p>", "295", "245", "50", "", "0", "1", "1,2", "3", "fix", "1");
INSERT INTO `menu_meny` VALUES("10", "0", "2", "3", "Sogliola", "<p>Bergtungsfile br&auml;serad i hummers&aring;s, r&auml;kor, gr&ouml;n sparris och potatisbakelse</p>", "265", "0", "60", "", "1", "0", "1,2", "", "fix", "0");
INSERT INTO `menu_meny` VALUES("11", "0", "3", "3", "Penne alla Piemontese", "<p>Penne med strimlad oxfil&eacute;, champinjoner och purjol&ouml;k i gr&auml;dds&aring;s.</p>\r\n<p><span style=\"font-size: 8pt;\"><em>Penne with filet of beef, mushrooms and leek in a cream sauce</em></span></p>", "195", "130", "50", "", "0", "1", "1,2", "1", "fix", "0");
INSERT INTO `menu_meny` VALUES("12", "0", "3", "3", "Delizie Ventricina", "<p>Gratinerade pastarullar fyllda med kryddstark calabresisk paprikasalami, fontinaost, parmesan och zucchini i gr&auml;ddig tomats&aring;s</p>\r\n<p><span style=\"font-size: 8pt;\"><em>Pasta rolls au gratin with ventricina salami,&nbsp;zucchini, parmesan and tomatocream sauce&nbsp;</em></span></p>", "190", "120", "50", "", "0", "1", "1,2", "2", "fix", "0");
INSERT INTO `menu_meny` VALUES("13", "0", "3", "3", "Linguine allaragosta di mar", "<p>Linguine med lax, kr&auml;ftstj&auml;rtar, musslor och r&ouml;dl&ouml;k i hummers&aring;s</p>\r\n<p><span style=\"font-size: 8pt;\"><em>Linguine with fish, crayfish, mussels, red onions in lobster sauce</em></span></p>", "190", "120", "50", "", "0", "1", "1,2", "3", "fix", "0");
INSERT INTO `menu_meny` VALUES("14", "0", "4", "3", "Cozze alla marinara", "<p>Vitvinsbr&auml;serade bl&aring;musslor med vitl&ouml;k persilja och tomatconcass&eacute;</p>\r\n<p><span style=\"font-size: 8pt;\"><em>Mussels braised in white wine, garlic, parsley and tomato concass&eacute;</em></span></p>", "115", "85", "19", "", "0", "1", "1,2", "5", "fix", "0");
INSERT INTO `menu_meny` VALUES("15", "0", "4", "3", "Bufala", "<p>Buffelmozzarella med tomat, basilika, olivolja extra vergine, chilipeppar, oregano och havssalt</p>\r\n<p><span style=\"font-size: 8pt;\"><em>Buffalo mozzarella with tomato, basil,&nbsp;olive oil, chili pepper, oregano and seasalt</em></span></p>", "105", "80", "17", "", "0", "1", "1,2", "6", "fix", "0");
INSERT INTO `menu_meny` VALUES("16", "0", "4", "3", "Carpaccio di manzo", "<p>Oxfil&eacute;carpaccio med rucola, olivolja extra vergine, citron, parmiggiano, rostade pinjen&ouml;tter och svartpeppar</p>\r\n<p><span style=\"font-size: 8pt;\"><em>Filet of beef carpaccio with rucola, olive oil, lemon, &nbsp;black pepper and roasted pine nuts with parmiggiano cheese</em></span></p>", "135", "103", "22", "2", "0", "1", "1,2", "7", "fix", "0");
INSERT INTO `menu_meny` VALUES("17", "0", "2", "3", "Cacciucco al Limone", "<p>Fisk &amp; skaldjurfricasse, gjord p&aring; lax, havskr&auml;fta, calamare, bl&aring;musslor, torsk och potatis, serveras med focaccia</p>", "265", "0", "60", "", "1", "0", "1,2", "", "fix", "0");
INSERT INTO `menu_meny` VALUES("18", "0", "2", "3", "Costata di manzo", "<p>Grillad Nebraska Beef, f&ouml;rsta klassens entrecot&eacute;, fritt str&ouml;vande, uppv&auml;xt p&aring; majs, gr&auml;s ock korn.&nbsp;Serveras med ragu p&aring; oxm&auml;rg i r&ouml;dvins&aring;s, scharlottenl&ouml;ksmajon&auml;s, grillad sparris med valfri contorni.</p>\r\n<p><span style=\"font-size: 8pt;\"><em>Grilled Nebraska Beefand served with ox marrow-redwine sauce,&nbsp;shallotmayonnaise, grilled asparagus.</em></span></p", "345", "320", "25", "", "0", "1", "1,2", "5", "fix", "1");
INSERT INTO `menu_meny` VALUES("19", "0", "2", "3", "Sella dagnello alla griglia", "<p>Grillade lammracks&nbsp;med rosmarin, vitl&ouml;k, chili, prim&ouml;rer och r&ouml;dvins&aring;s med valfri contorni.</p>\r\n<p><span style=\"font-size: 8pt;\"><em>Grilled lambracks and&nbsp;rosmary, garlic, chili, primeurs and redwinesauce.</em></span></p>", "295", "235", "50", "", "0", "1", "1,2", "6", "fix", "1");
