INSERT INTO `settings` VALUES("19", "new_content", "<h2>Boka&nbsp;Bord</h2>\r\n<p>F&ouml;r s&auml;llskap fler &auml;n 8 personer v&auml;nligen ring f&ouml;r bordsbokning.</p>");
INSERT INTO `settings` VALUES("20", "time_offset", "+2:00");
INSERT INTO `settings` VALUES("21", "takeaway_content", "<p style=\"text-align: center;\">P&aring; John Chris Coffee serverar vi ett brett utbud av hemlagade matr&auml;tter. Allt ifr&aring;n de popul&auml;ra h&auml;lsotallrikarna till den mustiga hummersoppan med vitl&ouml;ksbr&ouml;d och kr&auml;ftstj&auml;rtar, nygr&auml;ddad lasagne och v&aring;ra omtalade ljumna pastar&auml;tter. Hitta din favorit i v&aring;r meny!</p>\r\n<p style=\"text-align: center;\">F&ouml;r den som &auml;r sugen p&aring; en fikapaus finns h&auml;r bakverk, f&auml;rskpressad juice och kaffe f&ouml;r alla smaker. All personal har baristautbildning f&ouml;r b&auml;sta m&ouml;jliga smak p&aring; kaffet och maler bryggkaffet direkt p&aring; plats f&ouml;r att bevara aromerna. Vi jobbar bara med v&auml;lk&auml;nda kaffeleverant&ouml;rer och goda b&ouml;nor &ndash; som v&aring;rt espressokaffe Kimbo fr&aring;n Napoli i Italien.</p>");
