 huvudrtter tillagas p en kta kolgrill. Detta minskar intaget av mttade fetter och frlnger livet! Vi erbjuder ven ett brett urval av smrtter, sallader mm.\r\n\r\nVlkomna till en smakupplevelse frn sommarlandet Grekland!\";s:6:\"filter\";b:1;}i:18;a:3:{s:5:\"title\";s:0:\"\";s:4:\"text\";s:771:\"[MENU for=\"take-out\"]\r\n<div class=\"divider\"><img src=\"http://grekiska.icington.com/wp-content/uploads/2015/03/newdivider.png\"/></div>\r\n\r\n<div class=\"step-2-wrapper\"></div>\r\n\r\n <div class=\"menucart\">\r\n       <label>Catering</label>\r\n       <span>0</span>\r\n</div>\r\n    \r\n<div class=\"cart-detail\"></div>\r\n\r\n<div class=\"takeawaycart\">\r\n       <label>Bestll</label>\r\n       <span>0</span>\r\n</div>\r\n\r\n<div class=\"takeawaycart-detail\"></div>\r\n\r\n<div class=\"lunchmenycart\">\r\n       <label>Lunchmeny</label>\r\n       <span>0</span>\r\n</div>\r\n\r\n<div class=\"lunchmenycart-detail\"></div>\r\n\r\n<div class=\"breakfastcart\">\r\n       <label>Lunchmeny</label>\r\n       <span>0</span>\r\n</div>\r\n\r\n<div class=\"breakfastcart-detail\"></div>\r\n\r\n<div id=\"takeaway_form\" style=\" display:none\"></div> \";s:6:\"filter\";b:0;}i:19;a:3:{s:5:\"title\";s:0:\"\";s:4:\"text\";s:134:\"[MENU for=\"lunchmeny\"]\r\n<div class=\"divider\"><img src=\"http://grekiska.icington.com/wp-content/uploads/2015/03/newdivider.png\"/></div>\";s:6:\"filter\";b:0;}i:20;a:3:{s:5:\"title\";s:0:\"\";s:4:\"text\";s:110:\"<div class=\"divider\"><img src=\"http://grekiska.icington.com/wp-content/uploads/2015/03/newdivider.png\"/></div>\";s:6:\"filter\";b:0;}i:21;a:3:{s:5:\"title\";s:0:\"\";s:4:\"text\";s:428:\"<a href=\"#wrap\" class=\"mobile-home\">Hem</a>\r\n<div class=\"mobile-menu\">\r\n<h2>BARKARBY</h2>\r\n<span><a href=\"#avhamtningsmeny-sections\">Avhmtningsmeny</a></span>\r\n<span><a href=\"#lunchmeny-sections\">Lunchmeny</a></span>\r\n<span><a href=\"http://barkarby.grekiskakolgrillsbaren.se/wp-content/themes/outreach/pdf/Serveringsmeny.pdf\"> Serveringsmeny</a></span>\r\n<span><a href=\"#kontakta-oss-sections\">Kontakta oss</a></span>\r\n\r\n</div>\";s:6:\"filter\";b:0;}i:22;a:3:{s:5:\"title\";s:0:\"\";s:4:\"text\";s:182:\"loreum lipsumloreum lipsumloreum lipsumloreum lipsumloreum lipsumloreum lipsumloreum lipsumloreum lipsumloreum lipsumloreum lipsumloreum lipsumloreum lipsumloreum lipsumloreum lipsum\";s:6:\"filter\";b:0;}i:23;a:3:{s:5:\"title\";s:0:\"\";s:4:\"text\";s:134:\"[MENU for=\"lunchmeny\"]\r\n<div class=\"divider\"><img src=\"http://grekiska.icington.com/wp-content/uploads/2015/03/newdivider.png\"/></div>\";s:6:\"filter\";b:0;}i:24;a:3:{s:5:\"title\";s:0:\"\";s:4:\"text\";s:136:\"[MENU for=\"lunchmeny\"]\r\n<div class=\"divider\"><img src=\"http://grekiska.icington.com/wp-content/uploads/2015/03/newdivider.png\"/></div>\r\n\";s:6:\"filter\";b:0;}i:25;a:3:{s:5:\"title\";s:0:\"\";s:4:\"text\";s:105:\"Loreum Lipsum Loreum LipsumLoreum LipsumLoreum LipsumLoreum LipsumLoreum LipsumLoreum LipsumLoreum Lipsum\";s:6:\"filter\";b:0;}i:26;a:3:{s:5:\"title\";s:20:\"Bestll Avhmtning\";s:4:\"text\";s:114:\"\r\n<div class=\"divider\"><img src=\"http://grekiska.icington.com/wp-content/uploads/2015/03/newdivider.png\"/></div>\r\n\";s:6:\"filter\";b:0;}i:27;a:3:{s:5:\"title\";s:4:\"Meny\";s:4:\"text\";s:793:\"<p>Med vrt trevliga och varierande utbud av frrtter, huvudrtter och desserter r det ltt att komponera en smakfull 2- eller 3-rttersmeny.\r\n<br/>\r\nBrja mltiden med ngon av vra Italieninspirerade frrtter fr att sedan avnjuta ngon av de vllagade a la carte-rtterna. Till detta kan du vlja ett gott vin och avsluta mltiden med ngot stt frn vr inbjudande dessertmeny. Flera set menyer finns att vlja mellan dr kocken tar sig friheten att verraska gsterna med olika frrtter. Vnligen kontakta oss om ni vill ha information om de viner vi har att erbjuda.\r\n<br/>\r\nFr de minsta gsterna finns sklart barnens egen meny.</p>\r\n\r\n\r\n<div class=\"divider\"><img src=\"http://grekiska.icington.com/wp-content/uploads/2015/03/newdivider.png\"/></div>\";s:6:\"filter\";b:0;}i:30;a:3:{s:5:\"title\";s:0:\"\";s:4:\"text\";s:246:\"<span style=\"color: #FFFFFF;display: block; font-weight: 700; margin-top: 5px; padding-right: 30px\">Telefon: 021-417560 <a href=\"http://barkarby.grekiskakolgrillsbaren.se/webmin\" target=\"_blank\" style=\"margin-left: 15px;\">Personal login</a><span>\";s:6:\"filter\";b:0;}i:32;a:3:{s:5:\"title\";s:0:\"\";s:4:\"text\";s:0:\"\";s:6:\"filter\";b:0;}i:33;a:3:{s:5:\"title\";s:0:\"\";s:4:\"text\";s:0:\"\";s:6:\"filter\";b:0;}i:34;a:3:{s:5:\"title\";s:8:\"Catering\";s:4:\"text\";s:924:\"<p>Ristorante Limone erbjuder catering med samma hga kvalitet och engagemang som maten och knslan p vr vlknda restaurang i centrala Vsters\r\n<br/>\r\nVi har under flera r erbjudit catering och har mycket kunskap kring alla olika tillstllningar. Vi jobbar med stora fester som brllop likvl som vi erbjuder catering till en romantisk hemmamiddag fr tv personer. Fr de flesta strre tillstllningar skrddarsyr vi menyn efter era personliga nskeml.\r\n<br/>\r\nI denna meny hittar ni vra klassiska buffer samt vra mest omtyckta varmrtter. Vi r alltid redo att komma med frslag infr er bestllning, tveka inte om ni har speciella nskeml, allt gr att lsa!\r\n<br/>\r\n\"Med smaker av Italien fljer vi vrt egna recept: rvara, krlek, fantasi och respekt\"\r\n</p>\r\n \r\n<div class=\"divider\"><img src=\"http://grekiska.icington.com/wp-content/uploads/2015/03/newdivider.png\"/></div>\";s:6:\"filter\";b:0;}i:35;a:3:{s:5:\"title\";s:0:\"\";s:4:\"text\";s:374:\"lorem ipsumlorem ipsumlorem ipsumlorem ipsumlorem ipsumlorem ipsumlorem ipsumlorem ipsumlorem ipsumlorem ipsumlorem ipsumlorem ipsumlorem ipsumlorem ipsumlorem ipsumlorem ipsumlorem ipsumlorem ipsumlorem ipsumlorem ipsumlorem ipsumlorem ipsumlorem ipsumlorem ipsumlorem ipsumlorem ipsumlorem ipsumlorem ipsumlorem ipsumlorem ipsumlorem ipsumlorem ipsumlorem ipsumlorem ipsum\";s:6:\"filter\";b:0;}i:36;a:3:{s:5:\"title\";s:12:\"Veckanslunch\";s:4:\"text\";s:366:\"<p>Vecka 05\r\n<br/>\r\nLunch 105 kr \r\nAvhmtning, inkl. sallad och brd 90 kr\r\n<br/>\r\n11.00 - 13.30<br/>\r\nLunch 95 kr 11.30-13.30\r\nAvhmtning, inkl sallad o brd 80 k105\r\n<br/>\r\nI lunchen ingr antipasto, lingondryck/vatten\r\noch kaffe efter maten\r\n</p>\r\n<div class=\"divider\"><img src=\"http://grekiska.icington.com/wp-content/uploads/2015/03/newdivider.png\"/></div>\";s:6:\"filter\";b:0;}i:37;a:3:{s:5:\"title\";s:0:\"\";s:4:\"text\";s:299:\"<p><b>Lrdagslunch<br/>\r\n12,00-15,00<br/>\r\n Inkl. sallad, brd, ostkrm/tapenade samt vr hrliga dessert- och ostbuff<br/>\r\nOch vr hrliga buff med ostar och frukter.</b></p>\r\n<div class=\"divider\"><img src=\"http://grekiska.icington.com/wp-content/uploads/2015/03/newdivider.png\"/></div>\";s:6:\"filter\";b:0;}i:38;a:3:{s:5:\"title\";s:5:\"omoss\";s:4:\"text\";s:1419:\"<p>Limone r en lugn restaurang i romantisk milj som sedan 1996 r centralt belget i ett av Vsters vackra sekelskifteshus.\r\n<br/>\r\nDen genersa takhjden och de stora fnstren bidrar till en luftig och behaglig milj fr bde lunch- och middagsgster.\r\n<br/>\r\nNr ni bokar bord p Limone kan ni vara skra p att vi kommer att gra vrt yttersta fr att ni ska trivas. Service gentemot vra gster r en av hrnstenarna i vr ambition att vara en av stans bsta krogar. Maten tillagas av vr eminenta kkschef Salvatore Macri vars goda renomm r ett gott betyg fr alla vra trogna och terkommande njda gster. Limone har dessutom blivit omnmnd i White Guide inte mindre n 6 gnger!\r\n<br/>\r\nFrutom vr trevliga restaurangmilj kan vi erbjuda att laga maten till era festtillstllningar. P vr cateringmeny kan ni vlja mellan olika italienska menyer fr bde strre och mindre sllskap. Vi hjlper ven till att ordna er brllopsfest, firmafest eller annan tillstllning som ni vill ska bli perfekt.\r\n<br/>\r\nDu/ni som vill njuta av god mat hemma i soffan framfr en bra film kan bestlla take away frn vr ordinarie meny.\r\n</p>\r\nFrutom vr goda mat r vi stolta ver att kunna presentera en ekologisk vinmeny som vuxit fram genom ett fantastiskt samarbete med Naturligtvin.\r\n\r\nVlkomna till Limone  Vsters oas fr god mat och service!\r\n\";s:6:\"filter\";b:0;}i:39;a:3:{s:5:\"title\";s:14:\"koppresentkort\";s:4:\"text\";s:650:\"<div>\r\n<form>\r\nFrnamn:<input type=\"text\" name=\"name\" required/><br/>\r\nE-post:<input type=\"email\" name=\"email\" required/><br/>\r\n\r\nAntal presentkort:<input type=\"text\" name=\"ant\" required/><br/>\r\n\r\nEfternamn:<input type=\"text\" name=\"ename\" required/><br/>\r\n\r\nMobiletelefon:<input type=\"text\" name=\"ph\" required/><br/>\r\nVrde per presentkort:<input type=\"text\" name=\"per\" required/><br/>\r\n\r\nSka presentkorten hmtas p Limone eller ska de postas?:<br/><input type=\"text\" name=\"ska\" required/><br/>\r\n\r\nOm \"Postas\", vnligen uppge leverans- och fakturaadress samt org.nr/pers.nr<br/>\r\n<input type=\"textarea\" name=\"om\" required/>\r\n\r\n\r\n</form>\r\n</div>\";s:6:\"filter\";b:0;}s:12:\"_multiwidget\";i:1;}", "yes");
